import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom/cjs/react-router-dom.min';
import Cookies from 'js-cookie';

const Cart = () => {
  const [cartItems, setCartItems] = useState([]);

  useEffect(() => {
    let cart = Cookies.get('cart');
    cart = cart ? JSON.parse(cart) : [];
    setCartItems(cart);
  }, []);

  const calculateTotalPrice = () => {
    return cartItems.reduce((total, item) => total + item.price * item.quantity, 0).toFixed(2);
  };

  const removeItemFromCart = (itemId) => {
    const updatedCart = cartItems.filter(item => item.id !== itemId);
    setCartItems(updatedCart);
    Cookies.set('cart', JSON.stringify(updatedCart));
    window.dispatchEvent(new Event('cartUpdated'));
  };

  return (
    <div className="Cart" style={{ backgroundColor: '#F7EED3', padding: '20px' }}>
      <h1 className="mx-5" style={{ color: '#4D3621' }}>Your Shopping Cart</h1>
      <div className="container my-5">
        {cartItems.length > 0 ? (
          <div className="row">
            {cartItems.map(item => (
              <div key={item.id} className="col-lg-6 my-3">
                <div
                  className="cart-item d-flex align-items-center p-3 border rounded shadow-lg"
                  style={{ backgroundColor: '#EDE6D1', borderColor: '#6B695F' }}
                >
                  <img
                    src={item.image}
                    alt={item.name}
                    className="cart-item-image"
                    style={{ objectFit: 'cover', borderRadius: '8px', width: '80px', height: '80px' }}
                  />
                  <div className="flex-grow-1 ms-3">
                    <h5 className="cart-item-title" style={{ color: '#4D3621' }}>{item.name}</h5>
                    <p className="cart-item-price" style={{ color: '#6B695F' }}>Price: <span>${item.price}</span></p>
                    <p className="cart-item-quantity" style={{ color: '#6B695F' }}>Quantity: <span>{item.quantity}</span></p>
                    <p className="cart-item-subtotal" style={{ color: '#6B695F' }}>Subtotal: <span>${(item.price * item.quantity).toFixed(2)}</span></p>
                  </div>
                  <button
                    className="btn"
                    onClick={() => removeItemFromCart(item.id)}
                    style={{ backgroundColor: '#8A8B6F', color: '#F7EED3' }}
                  >
                    Remove
                  </button>
                </div>
              </div>
            ))}

            <div className="total-price-container text-center p-4 rounded w-100 mt-4" style={{ backgroundColor: '#EDE6D1' }}>
              <h4 className="text-success" style={{ color: '#4D3621' }}>Total: ${calculateTotalPrice()}</h4>
            </div>

            <div className='d-flex justify-content-center'>
              <Link
                to="/products"
                className="btn continueShoppingBtn mt-3 px-sm-5 py-2"
                style={{ backgroundColor: '#8A8B6F', color: '#F7EED3' }}
              >
                Continue Shopping
              </Link>
            </div>
          </div>
        ) : (
          <div className="empty-cart text-center">
            <p style={{ color: '#4D3621' }}>Your cart is currently empty.</p>
            <div className='d-flex justify-content-center'>
              <Link
                to="/products"
                className="btn continueShoppingBtn mt-3 px-sm-5 py-2"
                style={{ backgroundColor: '#8A8B6F', color: '#F7EED3' }}
              >
                Continue Shopping
              </Link>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default Cart;
